import { Navbar as BootstrapNavbar, Nav, NavDropdown } from 'react-bootstrap';
// import 'bootstrap';

const Navbar = () => {
    return (
        // <BootstrapNavbar collapseOnSelect className = "bg-dark text-dark">
        //     <BootstrapNavbar.Brand className = "text-light">Unscathed</BootstrapNavbar.Brand>
        //     <BootstrapNavbar.Toggle aria-controls="responsive-navbar-nav" />
        //     <BootstrapNavbar.Collapse id="responsive-navbar-nav">
        //         <Nav className = "ml-auto">
        //             <Nav.Link className = "text-light" href = "/home">Home</Nav.Link >
        //             <Nav.Link className = "text-light" href = "/about">About</Nav.Link >
        //             <Nav.Link className = "text-light" href = "/contact">Contact</Nav.Link >
        //         </Nav>
        //     </BootstrapNavbar.Collapse>
        // </BootstrapNavbar>
        <BootstrapNavbar collapseOnSelect expand="lg" bg="dark" variant="dark">
            <BootstrapNavbar.Brand href="#home">React-Bootstrap</BootstrapNavbar.Brand>
            <BootstrapNavbar.Toggle aria-controls="responsive-navbar-nav" />
            <BootstrapNavbar.Collapse id="responsive-navbar-nav">
                <Nav className="mr-auto">
                <Nav.Link href="#features">Features</Nav.Link>
                <Nav.Link href="#pricing">Pricing</Nav.Link>
                <NavDropdown title="Dropdown" id="collasible-nav-dropdown">
                    <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
                    <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
                    <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
                    <NavDropdown.Divider />
                    <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
                </NavDropdown>
                </Nav>
                <Nav>
                <Nav.Link href="#deets">More deets</Nav.Link>
                <Nav.Link eventKey={2} href="#memes">
                    Dank memes
                </Nav.Link>
                </Nav>
            </BootstrapNavbar.Collapse>
            </BootstrapNavbar>   
    )
}

export default Navbar
